void print_byte(uint8_t b){
    con_putc(hex_lut[(b>>4) & 0x0F]);
    con_putc(hex_lut[(b   ) & 0x0F]);
}

void main(){
    uint8_t i;
    uint16_t acc_b;
    uint16_t acc_c;
    
    uint8_t max_b;
    uint8_t max_c;
    
    uint8_t min_b;
    uint8_t min_c;

    
    con_init();
    con_put("Mapper speed test.");
    
    acc_b = 0;
    acc_c = 0;
    min_b = 255;
    min_c = 255;
    max_b = 0;
    max_c = 0;
    
    for(i=0; i<128; i++){
        if((i&0x0F) == 0){
            con_putc('.');
        }
        
        do_test();
        
        /*Gather statistical data*/
        acc_b += test_b;
        acc_c += test_c;
        if (min_b > test_b) min_b = test_b;
        if (min_c > test_c) min_c = test_c;
        if (max_b < test_b) max_b = test_b;
        if (max_c < test_c) max_c = test_c;
    }
    con_putc('\n');
    
    con_put("\nDelay:\n");
    con_put("    Min: 0x"); print_byte(min_b); con_put("    0x"); print_byte(min_c); con_putc('\n');
    con_put("    Max: 0x"); print_byte(max_b); con_put("    0x"); print_byte(max_c); con_putc('\n');
    con_put("    Acc: 0x"); print_byte(acc_b>>8); print_byte(acc_b); con_put("  0x"); print_byte(acc_c>>8); print_byte(acc_c); con_putc('\n');
    
    if((max_c == 0) && (max_b == 0)){
        con_put("\nCongrats! You made it! ;)");
    }
    else{
        con_put("\nMapper is too slow... :(");
    }
    
    
    while(1){
        
    }
}

